import React from 'react';
import logo from './assets/logo.svg';
import './App.css';

function App() {

  var title = "Copter"

  return (
    <div className="App">

      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <table style={ {backgroundColor : "grey ",display:'block'} }>
          <tbody>
            <tr>
              <td><img src={require('./assets/logo.svg')} width="50"></img></td>
              <td>React By Copter</td>
            </tr>
          </tbody>
        </table>
      </header>
    </div>
  );
}

export default App;
